INSERT INTO `review` VALUES (1,23,3,5,'It\'s an Excellent book','I have just read this book. Very good.','2018-11-02 23:16:26'),(4,2,8,4,'This is a very good book!','I have just read this book. Very good.','2018-11-09 13:29:19'),(6,10,7,4,'It\'s a good book','I have just read this book. Very good.','2018-11-09 13:31:14'),(7,10,6,5,'Excellent book!','A comprehensive book about Spring framework.','2018-11-09 23:03:06'),(8,9,6,4,'The best book I ever read','I just read this book to complete. Very good resource of learning Spring framework.','2018-11-13 05:06:06'),(9,3,6,5,'this has to be one of the best I have read','I have read many programming books as a Java Hobbyist, this has to be one of the best I have read. \r\nThe authors clear and concise explanation of functional programming concepts are remarkable. \r\nIf this guys were in my town I would buy all them a beer.','2018-11-13 05:10:26'),(10,3,8,2,'Unnecessarily verbose','Bought this book in 2017 and did not get around to using it till 2018. \r\nThe issue I struggle with is the unnecessary verbosity in this book. (e.g., author provides a bulleted list and then prefaces each list item with firstly, secondly, thirdly etc).','2018-11-13 05:15:32'),(13,2,7,5,'Outstanding book','Outstanding book.I really love it. Recommended.','2018-12-09 07:58:23'),(14,27,6,5,'I\'m very satisfied with this book','After reading 2/3 of this book, I\'m very happy. Recommended.','2019-11-21 17:24:04');
